import Media from "./Media";

function ProjectGridContainer(props) {
	const { mediaFeatured, id } = props;

	return (
		<figure
			onClick={() => {
				enableViewer(id, 0);
			}}
		>
			<Media type="video" asset={mediaFeatured.asset} gif={false} />
		</figure>
	);
}

export default ProjectGridContainer;
